    false,nt"url": null,nt"notes": "In 2002, Neal Smith National Wildlife Refuge
    became one of the first Land Management and Research Demonstration (LMRD) sites.
     These sites are intended to serve as learning centers and training grounds for
    land managers, where people both inside and outside the U.S. Fish & Wildlife Service
    can come to see land management practices happening on the ground.  This document
    outlines LMRD program activities on the Refuge from 2002 to 2008.",nt"license_title":
